import React from "react";
import { Link } from "react-router-dom";
import "./Home.css";

const Home = () => {
  return (
    <div className="containerHome">
      <div className="menu">
        <div className="logo">
          <Link>Sistema de Produto</Link>
        </div>
        <ul>
        <li>
            <Link to="/CadastroProduto">Cadastro de Produto</Link>
          </li>
        <li>
            <Link to="/CadastroCategoria">Cadastro de Categoria</Link>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Home;
